import React, { useState } from 'react';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = async (e) => {
    e.preventDefault();

    // Effectuer des opérations d'authentification ici
    // Envoyer les données (email et mot de passe) au serveur pour vérification
    // Gérer la réponse du serveur, stocker le token (s'il est valide) côté client, etc.
  };

  return (
    <div className='log'>
      <h1>Connexion</h1>
      <form className="f" onSubmit={handleLogin}>
        <div className="ex">
          <input
            type="email"
            name="email"
            id="email"
            placeholder="Rentrer votre email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div className="ex">
          <input
            type="password"
            name="password"
            id="password"
            placeholder="Rentrer votre mot de passe"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>
        <div className="ex">
          <input className="sub" type="submit" value="Connexion" />
        </div>
      </form>
    </div>
  );
};

export default Login;
